        if self.sortOrder != 'CLOSEST':
            result += " sortOrder='" + self.sortOrder + "'"
        if not self.hasChild():
            result += '/>' + '\n'
        else:
            result += '>' + '\n'
            if self.IS: # output this SFNode
                result += self.IS.toXML(indentLevel=indentLevel+1)
